import {
  Card,
  CardContent,
  CardMedia,
  Container,
  Grid,
  Typography,
} from "@mui/material";

const immagini = [
  {
    src: "/img/vol1.jpg",
    titolo: "Distribuzione a Sesto San Giovanni",
  },
  {
    src: "/img/vol2.jpg",
    titolo: "Distribuzione a Seriate",
  },
  {
    src: "/img/vol3.jpg",
    titolo: "Distribuzione a Milano",
  },
  {
    src: "/img/vol4.jpg",
    titolo: "Distribuzione a San Giuliano Milanese",
  },
  {
    src: "/img/vol5.jpg",
    titolo: "Distribuzione Monza",
  },
  {
    src: "/img/vol6.jpg",
    titolo: "Mappa della zona",
  },
];

export default function Galleria() {
  return (
    <Container maxWidth="lg" sx={{ mt: 3 }}>
      <Typography align="center" variant="h4" gutterBottom>
        Galleria fotografica
      </Typography>

      <Grid container spacing={3}>
        {immagini.map((img, i) => (
          <Grid item xs={12} sm={6} md={4} key={i} {...({} as any)}>
            <Card>
              <CardMedia
                component="img"
                height="200"
                image={img.src}
                alt={img.titolo}
              />
              <CardContent>
                <Typography variant="subtitle1">{img.titolo}</Typography>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Container>
  );
}
